import React from 'react'
import { Image, StyleSheet } from 'react-native'

const flip = 'data:image/png;base64,';


const flashOn = 'data:image/png;base64,';

const flashOff = 'data:image/png;base64,';

const deleteI = 'data:image/png;base64,';

const faceFilter = 'data:image/png;base64,';

const feedVideoPicker = 'data:image/png;base64,';

const music = 'data:image/png;base64,';

const preview = 'data:image/png;base64,';

const timer = 'data:image/png;base64,';

const trash = 'data:image/png;base64,';

export default function index(props,style) {

  var icon = '';
  switch (props.name) {
    case 'flip':
      icon = flip;
      break;

    case 'flash_on':
      icon = flashOn;
      break;
    case 'flash_off':
        icon = flashOff;
        break;
    case 'timer':
      icon = timer;
      break;
    case 'music':
      icon = music;
      break;
    case 'delete':
      icon = deleteI;
      break;

    case 'preview':
      icon = preview;
      break;  

    case 'picker':
      icon =feedVideoPicker;
      break;  
    default:
      break;
  }




  return <Image source={{ uri: icon }} style={styles.image} />
}

const styles = StyleSheet.create({
  image: {
    width: 40,
    height: 40,
    margin:5,
    padding:5
  },
})
